import React from 'react';
import { View, Text, StyleSheet, SafeAreaView } from 'react-native';

const HomeScreen = () => {

    return(
        //<SafeAreaView>
            <View style={styles.container}>
                <View style={styles.block1}>
                    <Text>This is the card area</Text>
                </View>
                <View style={styles.block2}>
                    <Text>This is balance</Text>
                </View>
                <View style={styles.block3}>
                    <Text>Options</Text>
                </View>
                <View style={styles.block4}>
                    <Text>Promos</Text>
                </View>
                <View style={styles.block5}>
                    <Text>Nav-bar</Text>
                </View>
            </View>
        //</SafeAreaView>
    );
} 

const styles = StyleSheet.create({
    container: {
        width:'100%',
        height: '100%',
        backgroundColor: '#3E7297',
    },
    block1:{
        flex:0.5,
    },
    block2:{
        flex:1,
    },
    block3:{
        flex:1,
    },
    block4:{
        flex:1,
    },
    block5:{
        flex:0.5,
    },
});

export default HomeScreen;
